  \"quivira-national-wildlife-refuge-narrative-report-september-1-to-december-31-1958\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Quivira National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1958. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, collections and receipts, and vegetation
  control. Resource management is outlined; topics include grazing and haying. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, and violations. Items of interest and  N-R forms
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
